import { useContext } from 'react';
import TaskContext from '../Context/TaskContext';

function TaskList() {

  const { taskList } = useContext(TaskContext);

  return (
    <main>
      <ul>
        { taskList ? taskList.map((task) => {
          return (
            <li>{task}</li>
          )
        })
            : null
        }
      </ul>
    </main>
  )
}

export default TaskList;
